export default function TeamPage() {
  const { locale } = useRouter()

  const hero = heroes.filter(h => h.language === locale)[0]
  const orient = orients.filter(h => h.language === locale)[0]
  const cta = ctas.filter(c => c.language === locale)[0]

  return (
    <Layout isContinue={true}>
      <Head>
        {locale === "ru" && (
          <title>Команда, которая вдохнет новую жизнь в Ваши проекты</title>
        )}
        {locale === "en" && (
          <title>A team that will breathe new life into your projects</title>
        )}
        <meta
          name="desctiption"
          content={
            locale === "ru"
              ? "Мы - команда увлеченных веб-разработчиков, которые разделяют видение веб-сайтов, которые являются высокопроизводительными, безопасными и простыми в обслуживании. Посмотрите на команду, которая стоит за вашим следующим проектом."
              : "We are a team of passionate web developers who share the vision of websites that are high performance, secure and easy to maintain. Take a look at the team behind your next project."
          }
        />
        <script
          type="application/ld+json"
          dangerouslySetInnerHTML={{
            __html: `
              {
                "@context": "http://schema.org",
                "@type": "Organization",
                "name": "PXSTUDIO",
                "url": "https://pxstudio.pw"
              }
            `,
          }}
        />
      </Head>

      <Hero {...hero} />
      <OrientSection {...orient} />
      <WeAreTeamSection />
      <ThingsThatWeValue />
      <TechnologyThatWeUse />

      <CTA {...cta} />
    </Layout>
  )
}